import React, { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import RegistrationForm from './Signup'; // Importing RegistrationForm component
import Login from './Login'; // Importing Login component
import RegistrationForm1 from './farmersignup'; // Importing RegistrationForm1 component

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetch("http://localhost:3000/message")
      .then((res) => res.json())
      .then((data) => setMessage(data.message));
  }, []);

  return (
    <div className="App">
      <h1>{message}</h1>
      <div>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Login />} /> {/* Use Login for root path */}
            <Route path="/Signup" element={<RegistrationForm />} /> {/* Use RegistrationForm for /signup path */}
            <Route path="/login" element={<Login />} /> {/* Use Login for /login path */}
            <Route path="/farmer_signup" element={<RegistrationForm1 />} /> {/* Use RegistrationForm1 for /user_signup path */}
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
